import request from '@/utils/request';
import { host } from "./utils";
export function createCase(data) {
  return request({
    url: host + '/api/case/add',
    method: 'post',
    data: data
  });
}
export function getCaseList(params) {
  return request({
    url: host + '/api/case/list',
    method: 'get',
    params: params
  });
}
export function getCaseIndexList(params) {
  return request({
    url: host + '/api/case/index_list',
    method: 'get',
    params: params
  });
}
export function getCasePage(page, params) {
  return request({
    url: host + '/api/case/page/' + page,
    method: 'get',
    params: params
  });
}
